                    { new Guid("89fd63e4-890a-4eab-9bc4-643be0a1a7c5"), "", 2, "<p><b>arbol</b></p><p>Category: Noun</p><p>Spelling: </p><p>Definitions:</p><ul><li>Planta de tronco leñoso, grueso y elevado que se ramifica a cierta altura del suelo formando la copa</li><li>Cuadro descriptivo que representa de forma gráfica las relaciones que tienen los elementos de un conjunto o las variaciones de un fenómeno</li><li>Barra fija o giratoria que en una máquina sirve para soportar piezas rotativas o para transmitir fuerza motriz de unos órganos a otros</li><li>Barra o eje que se usa en posición vertical y sirve de apoyo a una estructura que se desarrolla alrededor del mismo, como el árbol de una escalera de caracol</li><li>Madero que junto con otros se coloca perpendicularmente a la quilla de una embarcación y está destinado a sujetar las velas</li><li>Eje del órgano (instrumento musical) que, movido a voluntad del ejecutante, hace que suene o deje de sonar un registro</li><li>Punzón que usan los relojeros para perforar el metal y que tiene el mango de madera y la punta de acero</li><li>Pieza de hierro en la parte superior del husillo de la prensa de imprimir</li></ul><p>Examples:</p><ul><li>el Ministerio de Medio Ambiente tiene previsto plantar un millón de árboles en el próximo año</li><li>diagrama en árbol</li></ul>", "<p><b>calcio</b></p><p>Category: noun</p><p>Spelling: ˈkaltʃo</p><p>Definitions:</p><ul><li>impugnatura della pistola</li><li>parte del fucile che si appoggia alla spalla</li></ul><p>Examples:</p><ul><li>carabina con calcio in legno</li><li>L'aggressore lo colpì con il calcio della pistola.</li></ul><p>Category: noun</p><p>Spelling: ˈkaltʃo</p><p>Definitions:</p><ul><li>colpo dato con il piede</li><li>colpo dato con la zampa da animali forniti di zoccoli</li><li>il gioco del pallone</li><li>tiro effettuato colpendo col piede il pallone</li></ul><p>Examples:</p><ul><li>dare un calcio</li><li>prendere a calci</li><li>Il mulo tira calci se infastidito.</l