                    { new Guid("d301ba90-a962-4c9f-a975-ddf9c7607107"), "", 4, "<p><b>love</b></p><p>Category: Noun</p><p>Spelling: ləv</p><p>Definitions:</p><ul><li>an intense feeling of deep affection</li><li>a great interest and pleasure in something</li><li>a person or thing that one loves</li><li>(in tennis, squash, and some other sports) a score of zero; nil</li></ul><p>Examples:</p><ul><li>babies fill parents with feelings of love</li><li>their love for their country</li><li>his love for football</li><li>we share a love of music</li><li>she was the love of his life</li><li>their two great loves are tobacco and whiskey</li><li>love fifteen</li><li>he was down two sets to love</li></ul><p>Category: Verb</p><p>Spelling: ləv</p><p>Definitions:</p><ul><li>feel deep affection for (someone)</li><li>like or enjoy very much</li></ul><p>Examples:</p><ul><li>he loved his sister dearly</li><li>there were four memorial pages set up by her friends in honor of Phoebe, saying how much they loved and missed her</li><li>I just love dancing</li><li>I'd love a cup of tea</li><li>I love this job</li><li>they love to play golf</li></ul>", "", "", "<p><b>arbol</b></p><p>Category: Noun</p><p>Spelling: </p><p>Definitions:</p><ul><li>Planta de tronco leñoso, grueso y elevado que se ramifica a cierta altura del suelo formando la copa</li><li>Cuadro descriptivo que representa de forma gráfica las relaciones que tienen los elementos de un conjunto o las variaciones de un fenómeno</li><li>Barra fija o giratoria que en una máquina sirve para soportar piezas rotativas o para transmitir fuerza motriz de unos órganos a otros</li><li>Barra o eje que se usa en posición vertical y sirve de apoyo a una estructura que se desarrolla alrededor del mismo, como el árbol de una escalera de caracol</li><li>Madero que junto con otros se coloca perpendicularmente a la quilla de una embarcación y está destinado a sujetar las velas</li><li>Eje del órgano (instrumento musical) que, movido a voluntad del ejecutante, hace que suene o deje de sonar un registro</li><li>Punzón que usan los relojeros para perforar el metal y que tiene el mango de madera y la punta de acero</li><li>Pieza de hierro en la parte superior del husillo de la prensa de imprimir</li></ul><p>Examples:</p><ul><li>el Ministerio de Medio Ambiente tiene previsto plantar un millón de árboles en el próximo año</li><li>diagrama en árbol</li></ul>", "https://audio12.forvo.com/audios/mp3/4/r/4r_20_74_136_1.mp3", "<p><b>car</b></p><p>Category: Noun</p><p>Spelling: kɑː</p><p>Definitions:</p><ul><li>a four-wheeled road vehicle that is powered by an engine and is able to carry a small number of people</li></ul><p>Examples:</p><ul><li>she drove up in a car</li><li>we're going by car</li></ul>", new DateTime(2020, 1, 19, 11, 53, 16, 0, DateTimeKind.Utc), new Guid("5df3869c-a2e7-88dc-4e4d-9c3fb0049ff6"), new DateTime(2020, 3, 23, 11, 53, 16, 0, DateTimeKind.Utc), "SINGLE_BLOCK", new DateTime(2020, 1, 19, 11, 53, 16, 0, DateTimeKind.Utc), 8 },
